import React, { Component } from 'react'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
export class HistoricPerformanceCalender extends Component {
    constructor(props) {
        super(props);
        this.state = {
            timeFrame: ""
          };
          this.handleTimeFrame = this.handleTimeFrame.bind(this);
        }
        handleTimeFrame(date) {
          this.setState({
            timeFrame: date
          });
    }
    render() {
        return (
            <div>
                <div className="calenderMain">
                    <div className="wrapperCalendar">
                        <h4 className="promoHeading">Performance</h4>
                        <div className="row historicSelect" >
                            <div className="col-md-3">
                            <p className="promoCal">Time Period</p>
                                <DatePicker
                                    className="form-control datePickerValueStyling"
                                    selected={this.state.timeFrame}
                                    onChange={this.handleTimeFrame}
                                />
                            </div>
                            <div className="col-md-3">
                            <p className="promoCal">Shop Description</p>
                                <select id="inputSelect1" className="form-control">
                                    <option selected>Shop_1</option>
                                    <option>...</option>
                                </select>
                            </div>
                            <div className="col-md-3">
                            <p className="promoCal">AdGroup</p>
                                <select id="inputSelect1" className="form-control">
                                    <option selected>Choose AdGroup</option>
                                    <option>...</option>
                                </select>
                            </div>
                            <div className="col-md-3">
                            <p className="promoCal">AdGroup</p>
                                <select id="inputSelect1" className="form-control">
                                    <option selected>Choose</option>
                                    <option>...</option>
                                </select>
                            </div>
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}

export default HistoricPerformanceCalender
